import { useState } from 'react';
import './filter.scss';

const Filter = () => {
    const [term, setTerm] = useState("");
    const [todos] = useF
  const list = todos
    .slice(0, 10)
    .filter(({ title }) => title.search(term)>=0 );

  return (
    <div>
      <h1>Filter Todos</h1>
      <input
        type="text"
        value={term}
        onChange={(e) => setTerm(e.target.value)}
        placeholder="search"
      />

      {list.map((user) => (
        <div key={user.id}>
          <p>
            <b>{user.title}</b>
          </p>
        </div>
      ))}
    </div>
  );
};
export default Filter;
